import React from 'react';
import { Link } from 'react-router-dom';
import './canvas.scss';

export default function Navbar() {
  return (
  <>
    <ul>
      <div className="portfolio">
        <Link to="/portfolio" className="Link">Check out my projects here!<div className="portfolio__highlight"></div></Link>
        <div className="portfolio__underline"></div>
        <div aria-hidden className="portfolio__filled">Check out my projects here!</div>
      </div>
    </ul>
  </>
  );
};
